import React from 'react';
import web from '../image/to.jpeg';
import { NavLink } from 'react-router-dom';
import Link from '../components/Link';



function Home() {
    return (
        <>
         <Link 
          name='Welcome to About page' 
          imgsrc={web} visit= '/contact' 
          btname='Contact Now' />
         />

        </>
    );

};

export default Home;
